from web3 import Web3

# Set up the ABI
abi = [{"inputs":[{"internalType":"bytes","name":"transactions","type":"bytes"}],"name":"multiSend","outputs":[],"stateMutability":"payable","type":"function"}]

# Create Web3 instance (no provider needed for decoding)
w3 = Web3()

# Input data from transaction
input_data = ""

# Create the contract object
contract = w3.eth.contract(abi=abi)

# Decode the function selector and arguments
function_input = contract.decode_function_input(input_data)

# Display decoded data
function_called = function_input[0]  # Function object
args = function_input[1]            # Dictionary of parameters

print(f"Function: {function_called.fn_name}")
print(f"To: {args['to']}")
print(f"Amount: {args['amount']}")
